import styled from 'styled-components';

const Wrapper = styled.div`
  .dialog-actions-componet-grid {
    margin-top: 64px;
    & > button:first-child {
      margin-right: 10px;
    }
  }
  .dialog-actions-componet-fab1 {
    background: #ccc;
  }
  .dialog-actions-componet-fab2 {
    background: #ccc;
  }
`;
export default Wrapper;
